const appDesignProjects = [
    {
      id: 'airfilter',
      title: 'airfilter',
      img: `${airfilter}`,
      description:
        'Solving the problem of poor indoor air quality by filtering the air',
    },
    {
      id: 'eyecam',
      title: 'eyecam',
